import React from 'react';
import './Header.scss';

export default function Header() {
    return (

        <div className='header'>
            <header>
                <div className='header-logo'>
                    <img src='/assets/images/logo192.png' alt="Logo" />
                </div>
                <div>
                    <ul>
                        <li>About</li>
                        <li></li>
                    </ul>
                </div>
            </header>
        </div>
    )
}
